const likeReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case "LIKE_HOME":
      return [...state, action.payload];
    case "DELETE_HOME":
      return [action.payload];
    default:
      return state;
  }
};

export default likeReducer;

